import React from 'react';
import { useTranslation } from 'react-i18next';

const Work = () => {
    const { t } = useTranslation();

    return (
        <section id="work" className="max-w-screen-2xl w-full mx-auto flex flex-col items-start justify-center text-left my-48 px-8 md:px-16">
            <h2 className='mb-8 text-4xl'>{t('work')}</h2>
            <hr className='border-white/10 w-full'></hr>
            <span className='text-6xl font-extralight max-w-4xl py-24'>Shape Up - App Design</span>
            <hr className='border-white/10 w-full'></hr>
            <span className='text-6xl font-extralight max-w-4xl py-24'>Wassily Chair - 3D Render</span>
            <hr className='border-white/10 w-full'></hr>
            <span className='text-6xl font-extralight max-w-4xl py-24'>PersonaKit - Web App Design&Development</span>
            <hr className='border-white/10 w-full'></hr>
        </section>
    );
}

export default Work;
